import React from 'react'
import { Route, Routes } from "react-router-dom";
import Login from './Login';
import Signup from './Signup';

function Home() {
  return (
      <div>
      <Routes>
      <Route path="login" element={<Login />} />
      <Route path="login" element={<Signup />} />
      </Routes>
    </div>
  )
}

export default Home
